import React from 'react'
import 'reactstrap'
import NewUser from './NewUser'


export default function criaTabela(props){
    let nomes = [];
     for(let i = 0;i < props.linhas; i++){
         nomes.push(
             <tr>
                 <td>
                    <NewUser nome = "Teste"/>
                 </td>
             </tr>
         )
     }

     return(

             {nomes}
     )
   
}
